import React from "react";
import { TextField, MenuItem, ThemeProvider } from "@material-ui/core";
import languages from "../data/languages";

const Inputs = ({language,setLanguage}) => {
  return (
    <div classname="Inputs">

        <TextField id="filled-basic" label="Word" variant="filled" />
        <TextField
          select
          label="Language"
          value={language}
          onChange={(e) => setLanguage(e.target.value) }
          className="select"
        >
          {languages.map((item) => (
            <MenuItem key={item.label} value={item.label}>
              {item.value}
            </MenuItem>
          ))}
        </TextField>

    </div>
  );
};
export default Inputs;
